import React from "react";
import "./Numeros.css";

function Numeros() {

    const setNumber = (num) => {
        alert("Oprimi el "+num);
    }


    return (
        <div className="contain-button">
            <div><button 
            value={1} 
            onClick={() => {setNumber(this.value)}}
            
            >1
            
            </button></div>
            <div><button 
            value={2} 
            onClick={() => {setNumber(this.value)}}
            
            >2
            
            </button></div>
            <div><button 
            value={3} 
            onClick={() => {setNumber(this.value)}}
            
            >3
            
            </button></div>
            <div><button 
            value={4} 
            onClick={() => {setNumber(this.value)}}
            
            >4
            
            </button></div>
            <div><button 
            value={5} 
            onClick={() => {setNumber(this.value)}}
            
            >5
            
            </button></div>
            <div><button 
            value={6} 
            onClick={() => {setNumber(this.value)}}
            
            >6
            
            </button></div>
            <div><button 
            value={7} 
            onClick={() => {setNumber(this.value)}}
            
            >7
            
            </button></div>
            <div><button 
            value={8} 
            onClick={() => {setNumber(this.value)}}
            
            >8
            
            </button></div>
            <div><button 
            value={9} 
            onClick={() => {setNumber(this.value)}}
            
            >9
            
            </button></div>
            <div></div>
            <div><button value={0}>0</button></div>
            <div></div>
        </div>
    );
}

export { Numeros };
